import React, { Component } from 'react';

const Artist = (props) =>(
    <div className='artist'>
        <div className='place'>Place</div>
        <img src={props.image}/>
        <div className='name'>{props.name}</div>
        <div className='followers'>SekÄ—jai<span>{props.followers}</span></div>
        <div className='popularity'>Populiarumas<span>{props.popularity}</span></div>
    </div>
)

export default Artist;
